const Thumbnail = ({imageURL, caption}) => {
    return(
        <div className="thumbnail">
            <img src={imageURL} className="thumbnail__image"/>
            <h3 className="thumbnail__caption">caption</h3>
        </div>
    );
};

export default Thumbnail;
